+----------------+
|Game Description|
+----------------+

Some creepy critters are trying to take over your space station, so you'll have to save the day in this out-of-this-world adventure! Clear the bugs from your path as you repair the space station to advance to the next challenging level. It's easy to learn and light-years of fun!

Originally released in 2007.

+----------------------------------+
|Instructions / System Requirements|
+----------------------------------+

No install or crack is required for this portable version. Extract the ZIP file and create a shortcut to the executable (EXE) to play.

This game is compatible with Windows 95, 98, ME, 2000, XP, Vista(32/64bit) and 7(32/64bit). Requires DirectX 3.0 or later. Processor requirements: 333MHz CPU or higher. RAM requirements: 64 MB or higher. Requires a DirectX-compatible Sound and Video card with at least 16 MB of video memory.

